class Header extends React.Component{
  
  render(){
    var titles=[
        {
          id:1,
          name:'Home',
          status: true
        },
        {
          id: 2,
          name:'Category',
          status:true
        },
        {
          id:3,
          name:'Contact',
          status:true
        },
        {
          id: 4,
          name:'More',
          status: true
        }
      ];
      return(
          <div>
              
              <nav className="navbar navbar-inverse">
                  <a className="navbar-brand"  href="#/">Kengan Nogul</a>
                  <ul className="nav navbar-nav">
                      <li >
                          <a href="#/">{elements}</a>
                      </li>
                  </ul>
              </nav>
              
              
          </div>
      );
  }
}
export default Header;
